import React from "react";
import { Link } from "react-router-dom";
import { TextField, Fab } from '@material-ui/core';
import NavigationIcon from '@material-ui/icons/Navigation';
import './Lobby.css'

function Lobby(props) {

  const [gameID, setGameID] = React.useState("");
  const socket = props.socket;

  console.log(JSON.stringify(props));

  /*
  useEffect(() => {

    socket.on("CLIENT_CONNECTED", (data) => {
      console.log('Clients connected: ' + data);
      setNumClients(data);
    });

  }, []);

  function handleNextClick() {
    console.log('NEXT button was clicked');
    socket.emit('GOT_WORD', {gameID});
  }
  */

  const handleTextChange = (event) => {
    setGameID(event.target.value);
  };

  return (
    <div className="Lobby">
      <form noValidate autoComplete="off" className='input-form' >
        <TextField
          id="filled-basic"
          label="Game ID"
          color="primary"
          variant="outlined"
          onChange={handleTextChange}
        />
        <Link to={`/${gameID}`} className="join-game-button">
          <Fab
            variant="extended"
            size="large"
            color="primary"
            aria-label="add"
            className="join-game-button-inner"
          >
            <NavigationIcon className="join-game-button-icon" />
          </Fab>
        </Link>
      </form>
    </div>
  );
};

export default Lobby;
